import React, { useState } from 'react';
import { motion } from 'framer-motion';

const STATUS_COLORS = {
  Delivered: 'bg-green-100 text-green-700',
  'Out for Delivery': 'bg-blue-100 text-blue-700',
  Packed: 'bg-orange-100 text-orange-700',
  Placed: 'bg-gray-100 text-gray-700',
};

const MOCK_ORDERS = [
  {
    id: 'ORD12345',
    products: [
      { name: 'A2 Milk', image: 'https://images.unsplash.com/photo-1601924638867-3ec5d1c9b79f', qty: 2 },
      { name: 'Ghee', image: 'https://images.unsplash.com/photo-1550583724-b2692b85b150', qty: 1 },
    ],
    date: '2024-06-01 10:30',
    total: 499,
    status: 'Out for Delivery',
    eta: '15 min',
  },
  {
    id: 'ORD12344',
    products: [
      { name: 'Curd', image: 'https://images.unsplash.com/photo-1550583724-b2692b85b150', qty: 3 },
    ],
    date: '2024-05-28 18:10',
    total: 180,
    status: 'Delivered',
    eta: null,
  },
  {
    id: 'ORD12343',
    products: [
      { name: 'Paneer', image: 'https://images.unsplash.com/photo-1550583724-b2692b85b150', qty: 1 },
      { name: 'Butter', image: 'https://images.unsplash.com/photo-1550583724-b2692b85b150', qty: 2 },
    ],
    date: '2024-05-25 14:45',
    total: 320,
    status: 'Packed',
    eta: null,
  },
  {
    id: 'ORD12342',
    products: [
      { name: 'Milk', image: 'https://images.unsplash.com/photo-1550583724-b2692b85b150', qty: 4 },
    ],
    date: '2024-05-20 09:20',
    total: 200,
    status: 'Placed',
    eta: null,
  },
];

const statusOptions = ['All', 'Placed', 'Packed', 'Out for Delivery', 'Delivered'];

export default function MyOrdersPage() {
  const [filter, setFilter] = useState('All');
  const [search, setSearch] = useState('');
  const filtered = MOCK_ORDERS.filter(order =>
    (filter === 'All' || order.status === filter) &&
    (search === '' || order.id.toLowerCase().includes(search.toLowerCase()))
  );
  return (
    <section id="my-orders" className="section-padding bg-white">
      <div className="container-custom">
        <div className="flex flex-col md:flex-row md:items-center md:justify-between gap-4 mb-8">
          <h2 className="text-3xl font-bold text-dairy-green">My Orders</h2>
          <div className="flex gap-2">
            <input
              type="text"
              placeholder="Search by Order ID..."
              value={search}
              onChange={e => setSearch(e.target.value)}
              className="px-3 py-2 rounded-lg border border-dairy-green/30 focus:outline-none focus:ring-2 focus:ring-dairy-green text-gray-800 bg-dairy-cream/40"
            />
            <select
              value={filter}
              onChange={e => setFilter(e.target.value)}
              className="px-3 py-2 rounded-lg border border-dairy-green/30 focus:outline-none focus:ring-2 focus:ring-dairy-green text-gray-800 bg-dairy-cream/40"
            >
              {statusOptions.map(opt => <option key={opt}>{opt}</option>)}
            </select>
          </div>
        </div>
        <div className="grid gap-6">
          {filtered.map(order => (
            <motion.div
              key={order.id}
              whileHover={{ scale: 1.01 }}
              className="bg-white rounded-2xl shadow-lg p-6 flex flex-col md:flex-row md:items-center gap-6 border border-dairy-green/10"
            >
              <div className="flex-1 flex flex-col md:flex-row gap-4 items-center">
                <div className="flex gap-2">
                  {order.products.map((p, i) => (
                    <img key={i} src={p.image} alt={p.name} className="w-14 h-14 rounded-lg object-cover border-2 border-dairy-green" />
                  ))}
                </div>
                <div className="flex-1">
                  <div className="font-bold text-lg text-gray-800">Order #{order.id}</div>
                  <div className="text-gray-500 text-sm">{order.date}</div>
                  <div className="text-gray-700 text-sm mt-1">
                    {order.products.map((p, i) => (
                      <span key={i}>{p.qty}x {p.name}{i < order.products.length - 1 ? ', ' : ''}</span>
                    ))}
                  </div>
                </div>
              </div>
              <div className="flex flex-col items-end gap-2 min-w-[120px]">
                <div className="font-bold text-dairy-green text-lg">₹{order.total}</div>
                <div className={`px-3 py-1 rounded-full text-xs font-semibold ${STATUS_COLORS[order.status]}`}>{order.status}</div>
                {order.eta && <div className="text-xs text-gray-500">ETA: {order.eta}</div>}
                {['Placed', 'Packed', 'Out for Delivery'].includes(order.status) && (
                  <button className="btn-primary px-4 py-2 text-sm mt-2">Track Order</button>
                )}
              </div>
            </motion.div>
          ))}
          {filtered.length === 0 && <div className="text-gray-500 text-center py-12">No orders found.</div>}
        </div>
      </div>
    </section>
  );
}
